import React, { useState } from "react";
import DataAccessService from "../../../services/axios-service";

const HomeSearch = () => {
  const [homes, setHomes] = useState([]);
  const [searchQuery, setSearchQuery] = useState("");

  const handleSearch = async () => {
    try {
      const searchData = { query: searchQuery };
      const response = await DataAccessService.post(
        "/custom/homes/search",
        searchData
      );
      setHomes(response);
    } catch (error) {
      console.log(error);
    }
  };

  return (
    <div>
      <input
        type="text"
        value={searchQuery}
        onChange={(e) => setSearchQuery(e.target.value)}
        placeholder="Search for homes"
      />
      <button onClick={handleSearch}>Search</button>

      <div>
        {homes.map((home) => (
          <div key={home.id}>
            <h3>{home.title}</h3>
            <p>{home.description}</p>
            {/* Add more home details as needed */}
          </div>
        ))}
      </div>
    </div>
  );
};

export default HomeSearch;
